    const { user, signOut } = useContext(AuthGoogleContext)
    const { userLog, setUserLog} = useState(user)
    console.log(user.log)

    useEffect(() => {
        setUserLog(user)
    }, [user])

    return (
        <div>
            <button onClick={() => signOut()}>Sair</button>
            <h1>Hello world </h1>
        </div>
    )

}
